import React from 'react'

const FoodCards = () => {
  return (
    <div className='max-w-[1604px] mx-auto p-4 py-12 grid md:grid-cols-3 gap-6'>
        {/* Cards */}
        <div className='relative rounded-xl'>
            {/* Overlay */}
            <div className='absolute w-full h-full bg-black/50 rounded-xl text-white'>
                <p className='font-bold text-2xl px-2 pt-4'>Sun's Out, BOGO'S Out</p>
                <p className='px-2'>Through 8/626</p>
                <button className='border-white bg-white font-bold text-black mx-2 hover:bg-transparent duration-300 absolute bottom-4'>Order Now</button>
            </div>
            <img className='max-w-[160px] md:max-h-[200px] w-full object-cover rounded-xl' src='https://images.pexels.com/photos/376464/pexels-photo-376464.jpeg?auto=compress&cs=tinysrgb&w=600' alt='/'/>
        </div>
    </div>
  )
}

export default FoodCards
